import React from 'react';
import { Card, CardContent, Typography, Grid, StylesProvider } from '@material-ui/core';

const Cards = (props) => {
    //console.log(props);

    return (
        <div className={StylesProvider.container}>
            <Grid container spacing={3} justify="center">
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Infecterd</Typography>
                        <Typography varaint="h5" gutterBottom>Real Data</Typography>
                        <Typography varaint="h5" gutterBottom>Number of active cases of COVID-19</Typography>
                    </CardContent>
                </Grid>

            </Grid>
        </div>
    )
}
export default Cards;
